import React, { Component } from "react";
import Slider from "react-slick";

export default class LinksHint extends Component {
  render() {
    var settings = {
      dots: true,
      infinite: false,
      speed: 500,
      slidesToShow: 4,
      slidesToScroll: 4,
      initialSlide: 0, autoplay: true,
      speed: 2000,
      autoplaySpeed: 2000,
      cssEase: "linear",
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
    };
    return (
      <div>
        <h2> Responsive </h2>
        <Slider {...settings}>
          <div >
            <h3>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Itaque repellendus fugiat dolores possimus aspernatur explicabo pariatur nisi, qui porro consequatur illo blanditiis accusamus perferendis ab.</h3>
          </div>
          <div>
            <h3>Lorem ipsum dolor sit amet consectetur adipisicing elit. Voluptatem sed facilis incidunt dolor temporibus quos optio repudiandae dolores sapiente rem, hic corporis omnis sunt debitis.</h3>
          </div>
          <div>
            <h3>3</h3>
          </div>
          <div>
            <h3>4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
          <div>
            <h3>7</h3>
          </div>
          <div>
            <h3>8</h3>
          </div>
        </Slider>
      </div>
    );
  }
}
